import React from 'react';
import {Button, Col, Container, Jumbotron, Row} from 'react-bootstrap'
import {BrowserRouter as Router} from 'react-router-dom'
import './App.css';

import NavigationBar from "./Components/NavigationBar";
import Welcome from "./Components/Welcome.js";
import Fotter from "./Components/Fotter.js";
import Login from "./Components/Login";
import Register from "./Components/Register";

function App() {

    const marginTop = {
        marginTop : "20px"
    }

  return (
      <Router>
          <Route patch={"/"} exact component={NavigationBar}/>
          <Route patch={"/login"} exact component={NavigationBar}/>
          <Route patch={"/register"} exact component={NavigationBar}/>
        <Container>

            <Row>
                <Col lg={12} style={marginTop}>
                    <Switch>
                        <Route patch={"/"} exact component={Welcome}/>
                        <Route patch={"/login"} exact component={Login}/>
                        <Route patch={"/register"} exact component={Register}/>
                    </Switch>



                </Col>
            </Row>
        </Container>
          <Fotter/>
      </Router>
  );
}

export default App;
